}

.header h3 {
    font-size: 1.2rem;
    color: black;
    margin-top: 5px;
}

.header__back, .header__close {
    position: absolute;
    display: flex;
    justify-content: center;
    align-items: center;
    top: 0;
    width: 48px;
    height: 48px;
    cursor: pointer;

}

.header__back {
    left: 0;
}

.header__close {
    right: 0;
}.inspector {
    background: white;
    border-radius: 5px;
    box-shadow: 0 30px 50px 0 rgba(44,49,59,0.20);
    max-height: 675px;
    min-width: 310px;
    overflow: hidden;
}

.inspector__content {
    background: #f6f6f6;
    padding: 10px 19px;
    overflow-y: scroll;
    overflow-x: hidden;
    max-height: 560px;
}

.inspector__content--small {
    padding: 0;
    height: 545px;
}

html {
    font-size: 62.5%;
}

body {
    font-size: 1.1rem;
    color: #5a6170;
    font-family: "Poppins", sans-serif;
    margin: 30px;
}

h1, h2, h3, h4, h5, h6 {
    margin: 0;
    color: #9da6b8;
    font-family: "Poppins", sans-serif;
    font-weight: 500;
}

h4 {
    font-size: 1rem;
    text-transform: uppercase;
}

.inspector__main_content_wrapper {
    position: relative;
}.group-name {
    color: #6c63ff;
    padding: 5px 0 3px 0;
    font-size: 1.6rem;
}

.color-property {
    height: 80px;
    display: flex;
    align-items: center;
    justify-content: space-between;
}

.color-property:not(:first-child) {
    position: relative;
}

.color-property__group.color-property {
    position: relative;
    border-radius: 3px;
    margin: 10px 0;
}

.color-property:hover h1 {
    opacity: 0.8;
}

.color-property:hover .color-property--copy {
    opacity: 1;
}

.color-property--name-wrapper {
    margin-left: 22px;
}

.color-property--name {
    opacity: 0.6;
    letter-spacing: 1px;
    font-size: 1rem;
    text-transform: uppercase;
}

.color-property h1 {
    font-size: 2.4rem;
    font-weight: lighter;
}

.color-property--copy {
    margin: 6px 22px;
    padding: 12px;
    border-radius: 18px;
    opacity: 0;
    transition: all 0.5s;
    cursor: pointer;
}

.property {
    display: inline-block;
    width: 50%;
}

.property__wide {
    width: 100%;
}

.property__tall {
    margin-bottom: 5px;
}

.property__color, .property__asset {
    display: inline-block;
    width: 20px;
    height: 20px;
    transform: translateY(6px);
    margin-right: 5px;
    border-radius: 10px;
}

.property__asset {
    background-size: cover !important;
    background-position: center;
    flex-shrink: 0;
}

.property__asset-container {
    text-decoration: none;
    color: inherit;
    display: flex;
    align-items: center;
    padding: 0 19px;
    box-sizing: border-box;
}

.property__asset-container:hover {
    background: white;
}

.property__asset-description {
    overflow: hidden;
    text-overflow: ellipsis;
}

.property__value {
    margin: 2px 0 12px 0;
    display: inline-block;
}

.property-group__header {
    color: #484e5d;
    margin: 10px 0;
    font-size: 1.2rem;
}

.property-group {
    margin-bottom: 27px;
}

.og-image {
    width: 100%;
}

.box {
    display: flex;
    flex-direction: column;
    border-radius: 1px;
    font-size: 1rem;
    border-radius: 1px;
}

.box__margin {
    height: 138px;
    width: 258px;
    border: dotted 1px #6c63ff;
}

.box__padding {
    height: 78px;
    width: 168px !important;
    flex-shrink: 0;
    background-image: linear-gradient(65deg, rgba(107, 98, 255, 0.59), rgba(107, 98, 255, 0));
    border: solid 1px #6c63ff;
}

.box__node {
    color: #f4f6f9;
    background: #373c46;
    flex-shrink: 0;
    min-height: 18px;
    width: 78px !important;
}

.box__row {
    flex-direction: row;
    align-items: center;
}

.box > * {
    width: 100%;
    text-align: center;
}

.box:not(.box__row) {
    justify-content: space-around;
}

.round-handler {
    height: 5px;
    border-bottom-left-radius:5px;
    border-bottom-right-radius:5px;

}

.image-model__image {

}

.image-model__name {
    margin-top: 30px;

}

.image-model__size {
    font-size: 1.4rem;

}

    font-size: 10px;

    margin-left: 7px;

}

.image-model a {
    text-decoration: none;

}

.tabs li {
    width: 100%;
}

.tab {

    width: 100%
}

.tab > div {
    position: relative;
    display: inline-block;
}

.tab > div:after {

    right: 2px;
    bottom: -8px;
}

.tab__active > div:after {
    border-bottom: 2px solid #6c63ff;
}

.tab:hover {
    background-color: rgba(243, 245, 249, 0.5);
}

.tab svg {
    min-height: 16px;
}

.tab__active {
    color: #6c63ff;
    fill: #6c63ff;
}

.inspector__tab--padding {

}
.assets-container {
    width: 100%;

.asset:hover .asset--description {

}


.asset--description__name {

.asset--description__size {

}.tooltip--wrapper {
    display: flex;
    flex-direction: column;
    align-items: center;
}

.tooltip {
    position: absolute;
    opacity: 0;
    transition: all 0.5s;
    color: #c6d0e4;
    display: flex;
    flex-direction: column;
    align-items: center;
    transform: translateY(-150%);
    pointer-events: none;
    font-weight: bold;
    font-size: 0.9rem;

}

.tooltip--content {

}

.tooltip:after {

    height: 0;

}.notification--wrapper {
    position: relative;
    width: 100%;
    z-index: 100000;
}

.notification {
    opacity: 0;
    position: absolute;
    pointer-events: none;
    transition: all 0.5s;
    display: flex;
    overflow: hidden;
    justify-content: center;
    align-items: flex-start;
    width: 100%;
    min-height: 100px;
}

.notification__show {

}

.notification--content {
    padding: 9px 10px;

    background: #373c46;
    color: #c6d0e4;
    text-transform: uppercase;
    transition: all 0.5s;
    transform: translateY(-50%);
    font-weight: bold;
    font-size: 1rem;
    letter-spacing: 1px;
    box-shadow: 0 4px 9px 0 rgba(44, 48, 59, 0.6);
}

.notification__show .notification--content {
    transform: translateY(10px);
